import './Components/style.css';
import LoginPage from './Components/LoginPage';
function App() {
  return (
    <>
     <LoginPage/>

        <Route path="/Main" component={Main} />
        <Route path="/" component={LoginPage} />


      {/* <Main/> */}
    </>
  );
}

export default App;
